import ma1 from '../assets/img/ma2.png';

const ApplyTeacher = () => {
    return (
        <div className="mt-10 flex justify-between items-start">
            <div className=" ml-20 bg-white rounded-lg shadow-lg flex flex-col justify-center items-center">
                <img src={ma1} alt=" Teacher Application" className=" p-8 w-full h-full object-cover rounded-lg" />
                <h2 className="font-bold text-lg mt-2">Become a teacher</h2>
                <p className="mt-2 text-sm">Launched less than a year ago by Blackboard co-founder Michael Chasen, integrates exclusively.</p>
                <button className="bg-blue-500 text-white px-4 py-2 rounded-full mt-2">Apply</button>
            </div>
            <div className=" pl-20 mr-20 bg-white rounded-lg shadow-md flex flex-col justify-center items-center">
                <img src={ma1} alt="Teacher Application" className="p-8  w-full h-full object-cover rounded-lg" />
                <h2 className="font-bold text-lg mt-2">Become a teacher</h2>
                <p className="mt-2 text-sm">Launched less than a year ago by Blackboard co-founder Michael Chasen, integrates exclusively.</p>
                <button className="bg-blue-500 text-white px-6 py-3 rounded-lg mt-2 self-start">Apply</button>

            </div>
        </div>
    );
}

export default ApplyTeacher;
